import React, { Component } from "react";
import axios from "axios";
import "./form.css";

export class Form extends Component {
  constructor() {
    super();
    this.state = {
        user: null,

    };
  }

  getMessage = error =>
    error.response
      ? error.response.data
        ? error.response.data.message
        : JSON.stringify(error.response.data, null, 2)
      : error.message;

  register = () => {
    this.setState({ message: null });
    let {
      firstName,
      lastName,
      phoneNumber,
      email,
      username,
      password,
      price,
      timeFrame,
      realtor
    } = this.refs;
    axios
      .post("/register", {
        first_name : firstName.value,
        last_name : lastName.value,
        phone_number : phoneNumber.value,
        email : email.value,
        username : username.value,
        password : password.value,
        price : price.value,
        timeframe : timeFrame.value,
        realtor : realtor.value
      })
      .then(response => {
        this.setState({ user: response.data });
      })
      .catch(error => {
        this.setState({
          message: "Something went wrong: " + this.getMessage(error)
        });
      });
  };

  render() {
    return (
      <div>
        <form className="register">
          <h1>
            Create an account to get expert information on houses in the Pheonix
            area, already have an account? Click here to Log in!
          </h1>
          <label>First Name: </label>
          <input ref="firstName" type="text" />
          <label>Last Name: </label>
          <input type="text" ref="lastName" />
          <label>Phone Number: </label>
          <input type="text" ref="phoneNumber" />
          <label>Email: </label>
          <input type="text" ref="email" />
          <label>Username: </label>
          <input type="text" ref="username" />
          <label>Password: </label>
          <input type="password" ref="password" />
          <label>Price Range</label>
          <select name="Price" ref="price">
            <option value="Less than $ 99,999"> Less than $ 99,999 </option>
            <option value="$ 100,000 - $ 199,999">
              $ 100,000 - $ 199,999{" "}
            </option>
            <option value="$ 200,000 - $ 299,999">
              $ 200,000 - $ 299,999{" "}
            </option>
            <option value="$ 300,000 - $ 399,999">
              $ 300,000 - $ 399,999{" "}
            </option>
            <option value="$ 400,000 - $ 499,999">
              $ 400,000 - $ 499,999{" "}
            </option>
            <option value="$ 500,000 - $ 599,999">
              $ 500,000 - $ 599,999{" "}
            </option>
            <option value="$ 600,000 - $ 699,999">
              $ 600,000 - $ 699,999{" "}
            </option>
            <option value="$ 700,000 - $ 799,999">
              $ 700,000 - $ 799,999{" "}
            </option>
            <option value="$ 800,000 - $ 899,999">
              $ 800,000 - $ 899,999{" "}
            </option>
            <option value="$ 900,000 - $ 999,999 ">
              $ 900,000 - $ 999,999{" "}
            </option>
            <option value="+ $ 1,000,000"> + $ 1,000,000 </option>
          </select>
          <label>Time Frame: </label>
          <select ref="timeFrame">
            <option value="less than 30 days">less than 30 days</option>
            <option value="30-90 days">30 - 90 days</option>
            <option value="within 6 months">6 months</option>
            <option value="within a year">This years</option>
            <option value="year +"> Next year</option>
          </select>
          <label>Are you working with a realtor?</label>
          <select name="realtor" ref="realtor">
            <option value="false"> No </option>
            <option value="true"> Yes </option>
          </select>
          <input type="submit"  onClick={this.register}/>
        </form>
      </div>
    );
  }
}

export default Form;
